package homework15;

public class Review01 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		//Write a program to print numbers from 1 to 5 on the console by using do-while loop
		int i = 1;
		do {
			
			System.out.print(i +" ");
			i++;
		}while(i<=5);
		
		
	}

}
